import React from "react";
import { useDrop } from "react-dnd";

function Team(props) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: "employee",
    collect: (monitor) => ({
      isOver: !!monitor.isOver(),
    }),
    drop: (e, props) => {
      var team = JSON.stringify(props.team);
      localStorage.setItem("currentTeam", team);
    },
  }));
  return (
    <div className="teams" key={team.id} ref={drop}>
      <div> {team.Name} </div>
    </div>
  );
}

export default Team;
